var md5 = require('MD5');

module.exports = {
    name: "radio",

    fallbackcover: "data:image/png;base64, ",

    getSong: function(raw) {
        if (raw.info) {
            return {
                "id": md5(raw.info + raw.source),
                "title": raw.info,
                "artist": "",
                "album": raw.source,
                "cover": raw.cover || this.fallbackcover
            }
        } else {
            return {
                "id": md5(raw.title + raw.artist + raw.source),
                "title": raw.title,
                "artist": raw.artist,
                "album": raw.album + " (" + raw.source + ")",
                "cover": raw.cover || this.fallbackcover
            }
        }

    }
};
